import { Component } from "react";
import "./Navbar.css";
import logo from './assets/logo.png';

class Navbar extends Component{
    render(){
        return <div className="Navbar">
            <img src={logo} className="logo-nav"/>
        </div>
    }
}

export default Navbar;
